    @responses.activate
    def test_live(self):
        responses.add(responses.POST, 'http://localhost:9696/v2/hunt/live',
                      json={'result': {'active': True, 'created': '2019-11-14T20:52:13.740679', 'id': '40665587544314424', 'status': 'SUCCESS'}, 'status': 'OK'}
                      )
        responses.add(responses.PUT, 'http://localhost:9696/v2/hunt/live',
                      json={'result': {'active': False, 'created': '2019-11-14T20:52:13.740679', 'id': '40665587544314424', 'status': 'SUCCESS'}, 'status': 'OK'}
                      )
        responses.add(responses.GET, 'http://localhost:9696/v2/hunt/live?id=40665587544314424',
                      json={'result': {'active': False, 'created': '2019-11-14T20:52:13.740679', 'id': '40665587544314424', 'status': 'SUCCESS'}, 'status': 'OK'}
                      )
        responses.add(responses.DELETE, 'http://localhost:9696/v2/hunt/live?id=40665587544314424',
                      json={'result': {'active': False, 'created': '2019-11-14T20:52:13.740679', 'id': '40665587544314424', 'status': 'SUCCESS'}, 'status': 'OK'}
                      )
        api = PolyswarmAPI(self.test_api_key, uri='http://localhost:9696/{}'.format(self.api_version), community='gamma')
        with open('test/eicar.yara') as yara:
            live_hunt = api.live_create(yara.read())
        assert live_hunt.active
        assert live_hunt.status == 'SUCCESS'
        api.live_update(live_hunt.id)
        updated_live_hunt = api.live_get(live_hunt.id)
        assert not updated_live_hunt.active
        deleted_live_hunt = api.live_delete(live_hunt.id)
        assert live_hunt.id == deleted_live_hunt.id

